syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";

import "DailyDungeonEntryInfo.proto";

message GetDailyDungeonEntryInfoRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 945;
	}

	int32 retcode = 1;
	repeated DailyDungeonEntryInfo daily_dungeon_info_list = 2;
}
